import React from "react";
import ReactDOM from 'react-dom';
import Cards from "./Cards";
import "./index.css"
import Sdata from "./Sdata"

ReactDOM.render(
    <>
      <h1 className="heading_style">List of top 5 Netflix series in 2023</h1>
    {Sdata.map((val, index) => {
        console.log(index);
        return(
            <Cards 
            key= {val.id}
            imgsrc= {val.imgscr}
            title= {val.title}
            sname= {val.sname}
            link= {val.links}
      />
        );
    })}

     </>,
 document.getElementById("root")
);
